import Logo from '../assets/pizzaLogo.png'
function Navbar() {
    return (
        <div className= 'navbar'>
            <div className='leftSide'>
                <img src= {Logo} />
            </div>
            <div className= 'rightSide'> </div>
        </div>
    )
}

export default Navbar
